function Start(sWorldName, sLevelAreaName)
	Hydra.ActorDisable(SPAWNER_BOSS)
	local boss = Hydra.ActorsInGroup("Onyx_Watchtower_BossAds");
	
	for i, bossID in ipairs(boss) do
		Hydra.ActorFadeAndDelete(bossID, 2);
	end
	
	Hydra.ActorEnable(Boss_Trigger);
end

function Start(idActor, fRange, idActorDetector)
	Hydra.ActorPlaySimpleConversation(CONV_ENFORCER, idActorDetector)
end

function Start(idActorKiller, idActorKilled)
	Hydra.ItemDropAtActor(idActorKilled, STOREROOM_KEY)
end

function Start(idActor, idActorDetector)
	idPlayer = idActor
	
end

function Start(idActor, idActorDetector)
	if(Hydra.ActorIsAlive(idActor)) then
	
		Hydra.EventSend("StartOnyxWatchtowerBoss");
	
	end
end
